import React from "react";
import { useParams } from "react-router-dom";

import "./Item.css";

const Item = (items) => {
  const findItemById = (id) => {
    items.find((item) => item.id === id);
  };

  let {itemId} = useParams();

  const item = items.find((item) => item.id === id);
};

export default Item;
